def createBargraphic(data, config):
    plt.figure(figsize = (12,8),dpi = 300)
    plt.bar( data.values(), data.keys())
    plt.xlabel(config['xlabel'])
    plt.ylabel(config['ylabel'])
    plt.title(config['title'])
    plt.grid(True)
    plt.savefig('test.png')
    plt.show()
    

